INSERT INTO `base_episode` VALUES (1739,'2022-12-15 11:20:00.613245','2022-12-15 11:20:00.613245','tt3957774',1,1,'BoJack Horseman: The BoJack Horseman Story, Chapter One','A publishing house eagerly awaits BoJack\'s memoirs, but he hasn\'t even started yet. His agent/ex and his publisher try to talk him into working with a ghost writer, but BoJack\'s too despondent about being washed up to focus.','2014-08-22','25','https://m.media-amazon.com/images/M/MV5BMjI1MDQ3MzMzNF5BMl5BanBnXkFtZTgwMDE4ODM5MTE@._V1_SX300.jpg',608,35,'Bojack Horseman',NULL),(1740,'2022-12-15 11:20:01.209004','2022-12-15 11:20:01.209004','tt3982374',1,2,'BoJack Hates the Troops','BoJack gets into trouble after taking muffins a Navy Seal had \"dibs\" on and then calling American soldiers jerks on live television.','2014-08-22','25','https://m.media-amazon.com/images/M/MV5BMTU3MjAwNzM4Ml5BMl5BanBnXkFtZTgwODM0NjQzNjE@._V1_SX300.jpg',609,35,'Bojack Horseman',NULL),(1741,'2022-12-15 11:20:01.626810','2022-12-15 11:20:01.626810','tt3981116',1,3,'Prickly Muffin','A child actress from the sitcom BoJack starred in 20 years ago shows up at his house leading to a series of chaotic events.','2014-08-22','25','https://m.media-amazon.com/images/M/MV5BMTIyYjA1MjMtYjYxYi00ZWRjLWIzMmItMGRlNGZkN2Y4MDk1XkEyXkFqcGdeQXVyMzQxMTMwMDQ@._V1_SX300.jpg',610,35,'Bojack Horseman',NULL),(1742,'2022-12-15 11:20:02.226913','2022-12-15 11:20:02.226913','tt3980964',1,4,'Zoës and Zeldas','Bojack mentors Todd in his upcoming career; meanwhile Diane\'s ex-boyfriend writes an article about Mr. Peanutbutter for an online article.','2014-08-22','25','https://m.media-amazon.com/images/M/MV5BODhmNjVlMjktOWUxMi00ZTQ4LTkxMmUtOTU1NTM1ZDVmNjhjXkEyXkFqcGdeQXVyMzQxMTMwMDQ@._V1_SX300.jpg',611,35,'Bojack Horseman',NULL),(1743,'2022-12-15 11:20:02.683827','2022-12-15 11:20:02.683827','tt3978916',1,5,'Live Fast, Diane Nguyen','A business trip for BoJack and Diane takes a detour; Todd runs a scam that gets him in trouble.','2014-08-22','25','https